import React from 'react'
import { useNavigate } from 'react-router-dom';
import styled from 'styled-components';

function Home() {
    const navigate = useNavigate();
    return (
    <>
        <div>
        <h1>게임 설명</h1>
            <div>balance game.
                <br />
                마음에 드는 것을 골라보아요.
            </div>
            <button
            onClick={() => {
                navigate("/games");
            }}
            >입장하기</button>
        </div>
    </>
    )
}

export default Home

const StWrapper = styled.div`
    display: flex;
    align-items: center;
    border: 2pt solid black;
    border-radius: 15pt;
`
